class Solution {
  int minimumTime(List<int> nums1, List<int> nums2, int x) {
    int n = nums1.length;
    List<int> prefixSum = List.filled(n + 1, 0);
    for (int i = 0; i < n; i++) {
      prefixSum[i + 1] = prefixSum[i] + nums1[i];
    }
    if (prefixSum[n] <= x) return 0;

    Map<int, int> mp = {};
    for (int i = 0; i < n; i++) {
      nums1[i] += nums2[i];
      mp[nums1[i]] = i;
    }

    nums1.sort((a, b) => b.compareTo(a));
    int time = 0;
    for (int i = 0; i < n; i++) {
      if (prefixSum[n] - nums1[i] <= x) {
        return time + 1;
      }
      time++;
      int index = mp[nums1[i]]!;
      for (int j = index; j < n - 1; j++) {
        nums1[j] = nums1[j + 1];
        mp[nums1[j]] = j;
      }
      n--;
      for (int j = index + 1; j <= n; j++) {
        prefixSum[j] = prefixSum[j - 1] + (j - 1 < n ? nums1[j - 1] : 0);
      }
      if (prefixSum[n] <= x) {
        return time;
      }
    }
    return -1;
  }
}
